import classes from "./BoardsSummery.module.css";
const BoardsSummery = () => {
  return (
    <section className={classes.summary}>
      <h2>보드게임 대여/렌탈</h2>
      <p>특별한 날 </p>
      <p>친구,가족과 함께</p>
      <p>다양한 보드게임의 재미를 나눠보세요</p>
    </section>
  );
};
export default BoardsSummery;
